import React from 'react';
import {withRouter} from 'react-router';

function AppointmentList(props){
  const {appointments} = props
  return(
    <div>

    <p> You have {appointments.length} appointment comming up </p>
    {appointments.map(appointment => (
      <div className="consultList" key={appointment.id}>
        <p>Dr. {appointment.therapist_first_name}</p>
        <p>{appointment.therapist_last_name}</p>
        <img src={appointment.therapist_image} alt="therapist-img"/>
        <p>{appointment.date}</p>
        <p>{appointment.time}</p>
      </div>
    )
    )}

    </div>
 )
}
export default withRouter(AppointmentList);
